import React, { useState, useEffect } from 'react';
import { mockTransactions } from './../../mockData'; // Import mock data
import './../customer/css/DashboardPage.css'; // Add custom styles
import Notification from './../../Notification'; // Import the Notification component
import Navbar from '../../components/Navbar';

function DashboardPage() {
  const [transactions, setTransactions] = useState(mockTransactions); // Use mock data initially
  const [newTransaction, setNewTransaction] = useState({
    amount: '',
    currency: '',
    provider: 'SWIFT',
    accountNumber: '',
    swiftCode: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewTransaction(prev => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    // Simulate adding the transaction to the list
    const newMockTransaction = {
      ...newTransaction,
      id: transactions.length + 1,
      status: 'pending',
    };
    setTransactions([newMockTransaction, ...transactions]);
    setSuccess('Transaction submitted successfully');
    setNewTransaction({
      amount: '',
      currency: '',
      provider: 'SWIFT',
      accountNumber: '',
      swiftCode: '',
    });
  };

  return (
    <>
      <Navbar userType="Customer" />
      <div className="dashboard-container">
        <h2>Customer Dashboard</h2>

        {success && <Notification message={success} type="success" />}
        {error && <Notification message={error} type="error" />}

        <h3>Transaction History</h3>
        <table>
          <thead>
            <tr>
              <th>Amount</th>
              <th>Currency</th>
              <th>Provider</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {transactions.map(transaction => (
              <tr key={transaction.id}>
                <td>{transaction.amount}</td>
                <td>{transaction.currency}</td>
                <td>{transaction.provider}</td>
                <td>{transaction.status}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>Initiate a New Payment</h3>
        <form onSubmit={handleSubmit}>
          <div>
            <label>Amount</label>
            <input
              type="number"
              name="amount"
              value={newTransaction.amount}
              onChange={handleInputChange}
              required
            />
          </div>
          <div>
            <label>Currency</label>
            <input
              type="text"
              name="currency"
              value={newTransaction.currency}
              onChange={handleInputChange}
              required
            />
          </div>
          <div>
            <label>Provider</label>
            <select
              name="provider"
              value={newTransaction.provider}
              onChange={handleInputChange}
              required
            >
              <option value="SWIFT">SWIFT</option>
            </select>
          </div>
          <div>
            <label>Account Number</label>
            <input
              type="text"
              name="accountNumber"
              value={newTransaction.accountNumber}
              onChange={handleInputChange}
              required
            />
          </div>
          <div>
            <label>SWIFT Code</label>
            <input
              type="text"
              name="swiftCode"
              value={newTransaction.swiftCode}
              onChange={handleInputChange}
              required
            />
          </div>
          <button type="submit">Pay Now</button>
        </form>
      </div>
    </>
  );
}
export default DashboardPage;
